module.exports = JSON.parse("{\"seoTitle\":\"SubReader\",\"hero\":{\"title\":\"Oplste undertekster p udenlandske film\",\"movie-btn\":\"Se filmen om SubReader\",\"button\":\"Lr mere om SubReader\",\"alt\":\"Oplste undertekster hero billed\"},\"worksWith\":{\"trial-btn\":\"Prv 14 dage gratis\",\"title\":\"Brug SubReader med alle dine streamingtjenester\",\"services\":[{\"logo\":\"netflix\",\"alt\":\"Virker med Netflix\"},{\"logo\":\"viaplay\",\"alt\":\"Virker med Viaplay\"},{\"logo\":\"disney\",\"alt\":\"Virker med Disney Plus\"},{\"logo\":\"drtv\",\"alt\":\"Virker med DRTV\"}]},\"howAppWorks\":{\"title\":\"Sdan kommer du i gang\",\"to\":\"/subscription/monthly\",\"info\":{\"title\":\"Hent SubReader\",\"content\":\"SubReader virker p bde iPhone og Android telefoner, s alle kan bruge den til oplsning af undertekster p film og serier. S der er ingen undskyldninger for ikke at downloade SubReader appen, sl benene op og nyd en god film. \",\"button\":\"Prv 14 dage gratis\",\"binding\":\"Ingen binding\",\"alt\":\"Hent ned SubReader App\"},\"info2\":{\"title\":\"Sg efter dine film\",\"content\":\"SubReader sger efter film og serier p tvrs af alle dine streamingtjenster, hvilket gr at du kan se film med oplste undertekster p tusindvis af film og serier. Med SubReader Plus har du adgang til alle de bedste stemmer til oplsning af undertekster til Netflix, Viaplay, Disney+ og HBO Nordics.\",\"button\":\"Prv 14 dage gratis\",\"binding\":\"Ingen binding\",\"alt\":\"Sg efter dine film med SubReader appen\"},\"info3\":{\"title\":\"Lad appen lytte med\",\"content\":\"Start filmen og lad SubReader lytte med i 10 sekunder, s finder den selv ud af hvornr underteksterne skal lses hjt. Appen synkroniserer det helt automatisk, og det gr opstning af SubReader nemt og hurtigt.\",\"button\":\"Prv 14 dage gratis\",\"binding\":\"Ingen binding\",\"alt\":\"Lad appen synkronisere din film \"}},\"movie\":{\"title\":\"Sl benene op og nyd din film\",\"content\":\"Vlg mellem de mange gode stemmer og find den du bedst kan lide. Ln dig tilbage, sl benene op og nyd et helt nyt univers af udlandske film med oplste undertekster.\",\"button\":\"Kom i gang med SubReader\",\"scrollInto\":\"Subscriptions\"},\"whySubReader\":{\"testimonial\":{\"title\":\"Derfor skal du bruge SubReader\",\"content\":\"Med SubReader kan du se alle de nyeste udenlandske film og serier p lige fod med alle andre. SubReader lser diskret underteksterne hjt, uden at forstyrre andre. SubReader er derfor et godt hjlpemiddel til ordblinde og personer med lsevanskeligheder.\",\"review\":\"I dag har jeg set en engelsk film for frste gang i hele mit liv. Det var en helt fantastisk oplevelse - SubReader har bnet en helt ny verden for mig.\",\"author\":\"Camilla Mller\",\"authorSubtitle\":\"Ordblind\"},\"feature\":{\"title\":\"Brug p alle enheder\",\"content\":\"Uanset om du ser din film med SubReader p TV'et i stuen eller p computeren i sengen kan SubReader srge for oplsning af undertekster.\"},\"feature2\":{\"title\":\"Sg p alle dine streamingtjenester\",\"content\":\"Indtast titlen p din film eller serie, s sger appen p tvrs af tusindvis af film og serier hos Netflix, Disney+, Viaplay og HBO Nordic.\"},\"feature3\":{\"title\":\"Altid lige ved hnden\",\"content\":\"Med SubReader kan du f oplst underteksterne p dine yndlings film og serier. Uanset om du hygger hjemme i stuen eller p ferie i sommerhuset.\"}},\"subscriptions\":{\"title\":{\"content\":\"F adgang til en verden af underholdning med \",\"span\":\"SubReader Plus\"},\"features\":[\"Brug i Biografen\",\"Brug med DRTV\",\"Brug med Netflix\",\"Brug med Disney+\",\"Brug med Viaplay\"],\"binding\":\"Ingen binding\",\"yearly\":{\"title\":\"rligt\",\"button\":\"Prv 14 dage gratis\",\"banner\":\"Spar {{percent}}\",\"year\":\"r\"},\"monthly\":{\"title\":\"Mnedligt\",\"button\":\"Prv 14 dage gratis\",\"month\":\"mned\"}},\"testimonials\":{\"1\":{\"content\":\"I dag har jeg set en engelsk film for frste gang i hele mit liv. Det var en helt fantastisk oplevelse - SubReader har bnet en helt ny verden for mig.\",\"author\":\"Camilla Mller\",\"alt\":\"Billed af Camilla som er ordblind\",\"authorSubtitle\":\"Ordblind\"},\"2\":{\"content\":\"Jeg har to ordblinde brn. Den ene begyndte helt at grde af glde, for nu er der mange film han gerne vil se.\",\"author\":\"Lone Munch\",\"alt\":\"Billed af Lone som er mor til ordblinde\",\"authorSubtitle\":\"Mor til ordblind\"},\"3\":{\"content\":\"Nu kan jeg komme en resnegl I det ene re, og lytte til filmen med det andet, og s kan jeg vre med p samme vilkr som alle andre. \",\"author\":\"Christian Bock\",\"alt\":\"Billed af Christian Rock som er ordblindmentor\",\"authorSubtitle\":\"Ordblindementor\"},\"title\":\"Det siger brugerne om SubReader\"},\"download\":{\"title\":\"F oplst undertekster med SubReader i dag\",\"content\":\"Hent SubReader appen ned p din telefon, s er du klar til at f oplst underteksterne p alle dine streamingtjenster.\",\"alt\":\"Med SubReader kan du f oplst undertekster fra alle dine streamingtjenester\"}}");

