module.exports = JSON.parse("{\"seoTitle\":\"Integritetspolicy\",\"seoDescription\":\"Hr kan du lsa mer om vr integritetspolicy gllande SubReaders hemsida och app.\",\"title\":\"Integritetspolicy\",\"p1\":\"Vi samlar in information fr att det ska vara mjligt fr dig att f upplsning av undertexter. Detta innebr att vi samlar in personlig information och Annan information.\",\"list\":[\"Informationen som du ger oss: Nr du skapar ett konto hos oss. Detta kan till exempel vara namn, e-postadress, lsenor och land. Vi kan ocks registrera din plats.\",\"Information och uppgifter som vi samlar in automatiskt nr du anvnder SubReader: Nr du anvnder SubReader registrerar vi automatiskt ett antal uppgifter, inklusive personlig information och information om hur du anvnder tjnsten. Denna information r ndvndig fr att vi ska kunna skerstlla den bsta kommunikationen mellan dig som anvndare och oss som fretag.\",\"Nr du deltar i underskningar, tvlingar eller give-aways samlar vi in kontaktinformation, demografi och annan information. Vi kan sponsra tvlingar, utdelningar eller andra erbjudanden dr vi kan krva att du frser oss med dina personuppgifter ssom; namn, e-postadress, telefonnummer och lder samt annan information som kan vara relevant fr ditt deltagande.\",\"Nr du fljer eller ansluter dig till vra sociala medier kan vi komma att samla in din konto- eller profilinformation. Du kan vlja att logga in eller registrera dig fr tjnsten med Facebook eller andra sociala ntverkstjnster. Nr du kopplar ditt sociala mediakonto s samlar vi in personuppgifter som du har angivit p din sociala profil. Till exempel nr du loggar in med dina Facebook-uppgifter s ger du oss tilltelse att samla in personuppgifter frn din Facebook-profil vilket behandlas under Facebooks villkor, ssom din e-postadress. Om du inte vill frse oss med denna information mste du ndra dina instllningar under din sociala mediaprofil.\",\"Nr du anvnder vra tjnster samlar vi in information om ditt anvndningsbeteende p plattformen. Vi samlar automatiskt in din loggdata och enhetsinformation. Vi anvnder cookies och andra liknande teknologier. SubReader samlar in information relaterade till dina betalningar via SubReader-plattformen. Denna information r ndvndig fr att upprtthlla avtalet mellan dig och SubReader.\"],\"4-2\":{\"heading\":\"1. Hur anvnder vi dina personuppgifter\",\"p1\":\"Vi anvnder dina uppgifter fr att driva vrt fretag, marknadsfring och fr att frbttra vr plattform samt utveckla nya tjnster och ge dig en mer personlig upplevelse nr du interagerar med oss. Vi anvnder ocks din information fr att kunna kommunicera med dig.\",\"p2\":\"Vi anvnder din information till fljande:\",\"list\":[\"Att driva vrt fretag och vra tjnster. Vi anvnder dina personuppgifter fr att skapa och hantera ditt personliga konto p SubReader samt att hantera dina bestllningar.\",\"Anpassa din upplevelse av vra tjnster fr att bttre frst vra anvndare och f anvndarinsikt. Vi anvnder din personliga information fr att gra analyser som kan frbttra tjnstens funktionalitet. Vi kan anvnda dina interaktioner med plattformen, din kphistorik och preferenser samt liknande information som du skickar till SubReader-plattformen.\",\"Kommunicera med dig och svara p dina nskeml. Nr du registrerar dig hos oss ger du tillstnd fr oss att kommunicera med dig via e-post eller push-meddelanden. Vi kan komma att anvnda dina personuppgifter fr att kunna kommunicera med dig om SubReader-produkter eller tjnster som du har kpt eller fr att informera om andra produkter, kampanjer eller tjnster som vi tror att du kan vara intresserad av. Du kan alltid kontrollera sttet som vi kommunicerar med dig p genom att g in i kontoinstllningar p hemsidan. Vi anvnder ocks dina personuppgifter fr att ge teknisk support eller hjlp p plattformen. Vi kan komma att skicka e-postmeddelanden, ven om du har valt bort det, om uppdateringar av vra villkor och handelsvillkor.\",\"Anpassa vr reklam och marknadsfring. Vi anvnder dina personupplysningar fr att skicka reklam och marknadsfringskampanjer som ger dig information om de produkter som vi tycker r mest relevanta fr dig. Frbehllet att du har gett oss tilltelse att skicka meddelanden med marknadsfring och reklam eller annan information. Vi anvnder dina preferenser och information (bland annat frn sociala medier) fr att skicka meddelanden med innehll som vi tnker passar bst fr dig. Du har alltid mjlighet att avsluta prenumerationen p alla typer av marknadsfringsmaterial frn SubReader.\"]},\"4-3\":{\"heading\":\"1.2 Var r dina personuppgifter sparade\",\"p1\":\"SubReader anvnder ett antal olika tredjepartsleverantrer fr att vi ska kunna erbjuda tjnster relaterade till SubReader-plattformen. Dessa leverantrer kan vara belgna inom eller utanfr Europeiska Ekonomiska Samarbetsomrdet (ESS). All hantering och verfring av dina personuppgifter kommer att ske i enlighet med gllande lagar.\",\"p2\":\"Dessa tjnsteleverantrer kommer endast ha begrnsat tkomst till dina upplysningar fr att utfra uppgifter fr vr rkning och r avtalsenligt skyldiga att skydda och anvnda informationen endast fr det verenskomna ndamlet. Detta r i enlighet med dessa villkor. Vi har vidtagit ndvndiga tgrder fr att skerstlla en lmplig niv av dataskydd. Detta kan baseras p EU:s modellklausuler (ett antal klausuler utfrdade av Europeiska kommissionen).\"},\"4-4\":{\"heading\":\"1.3. Hur lnge r dina personuppgifter sparade\",\"p1\":\"SubReader sparar dina personuppgifter s lnge du har ett konto hos oss eller behver anvnda vra tjnster. Vi behller och anvnder dina uppgifter efter behov fr att flja vra juridiska riktlinjer och lsa tvister.\"},\"4-5\":{\"heading\":\"1.4. Vem r ansvarig fr dina personliga uppgifter\",\"p1\":\"SubReader ApS r uppgiftsbehandlare p den information du skickar till oss och r drmed den ansvariga fr uppgifterna.\"},\"4-6\":{\"heading\":\"1.5. Vem har tillgng till mina personuppgifter\",\"p1\":\"Din information kan delas i SubReader ApS och tillhrande dotterbolag som r relaterat till gande eller kontroll. Vi skickar, sljer eller anvnder aldrig din information fr marknadsfringsmssiga tillgg till tredjepart utanfr SubReader ApS gruppen. Uppgifter som skickas vidare till tredje part anvnds uteslutande fr att tillhandahlla ovanstende tjnster, till exempel medietjnster och byrer fr distribution av nyhetsbrev, kreditupplysning, identitetskontroll och inkasso.\"},\"4-7\":{\"heading\":\"1.6. Hur skyddar vi dina uppgifter\",\"p1\":\"Vi anvnder tekniska och organisatoriska processer fr att skydda dina uppgifter frn att g frlorade, manipuleras eller hamna hos obehriga. Vi fortstter att integrera initiativ som fljer den tekniska utvecklingen. Fr att gra betalningen s enkel som mjligt anvnder vi krypterade formulr. Detta innebr att din information skickas via en sker anslutning och att externa parter inte kan komma t dina personuppgifter. Nr du betalar med kort arbetar vi med betalningsfrvrvare fr att kontrollera direkt med din bank att ditt kort r validerat fr kp. Vra betalningslsare behandlar dina kortuppgifter med hnvisning till den internationella skerhetsstandarden PCI DSS som har utvecklats av betalkortsfretagen VISA, MasterCard, Diners, American Express och JCB. Detta innebr att ditt betalkort behandlas med en mycket hg skerhetsniv. Nr du betalar med kort frbehller vi oss rtten att utfra en identitetskontroll.\"}}");

